	        var pop_con = contentDom.find('.x-pop-content');
	        var pop_btn = contentDom.find('.x-pop-button');

	        pop_con.html(option.content);
	        pop_btn.html(btnHtml);

	        initPosition(mainDom);

	        pop_btn.find('button').click(function(){
	            onClose();
	        });

