	        textrotate:0, //X轴旋转度数，默认为0
	        yaxisType:[{type:'value'}],  //Y轴坐标轴线默认一条
	        xTextStyle:'',  //X轴文本样式
	        serLabelText:true, //柱子文本标签是否显示
